import 'bootstrap/dist/css/bootstrap.min.css';
import "./Carousel.css"

function Carousel () {
    return (
        // <!-- Slideshow container -->
        <div>
            <div className="slideshow-container-car">
                {/* <!-- Full-width images with number and caption text --> */}
                <div className="mySlides-car fade-car active">
                    <img src="../../images/animation_! 1.png"/>
                    <div className="text-car">Caption Text</div>
                </div>

                <div className="mySlides-car fade-car">
                    <img src="../../images/animation_2 1.png"/>
                    <div className="text-car">Caption Two</div>
                </div>

                <div className="mySlides-car fade-car">
                    <img src="../../images/tourist.png"/>
                    <div className="text-car">Caption Three</div>
                </div>

                {/* <!-- Next and previous buttons --> */}
                <a className="prev-car" onclick="plusSlides(-1)">&#10094;</a>
                <a className="next-car" onclick="plusSlides(1)">&#10095;</a>
            </div>
            {/* <!-- The dots/circles --> */}
            <div style={{textAlign: "center"}}>
                <span className="dot-car" onclick="currentSlide(1)"></span>
                <span className="dot-car" onclick="currentSlide(2)"></span>
                <span className="dot-car" onclick="currentSlide(3)"></span>
            </div>
        </div>
    );
}

export default Carousel;
